The '''jungle bush''' is a bush found at the entrance of the [[Kharazi Jungle]]. A number of jungle bushes and [[Jungle Tree (dense Kharazi Jungle)|jungle trees]] form a dense boundary that must chopped down in order to progress through the jungle. Chopping the bush rewards the player with 100 [[Woodcutting]] experience for each set of [[logs|normal logs]] chopped. In order to access the jungle, the player must reach the point of [[Legends' Quest]] where [[Radimus Erkle]] provides the [[Radimus notes]].

Jungle bushes share the same mechanics as the jungle trees in the dense Kharazi Jungle. After being chopped down, the jungle bush becomes a [[slashed bush]] for a few seconds before respawning.

A [[Jungle Bush (Ape Atoll)|variant]] jungle bush can be found on [[Ape Atoll]], but the variant cannot be chopped down.

==Mechanics==
Once a player begins chopping the bush, it will be chopped until depleted, and after depleted the character will walk to the other side of the bush. This will occasionally put the player inside of another jungle tree or bush, which can be freely walked out of as long as nothing is blocking the path.

The bush sometimes provides regular logs when cut, and players will receive 100 Woodcutting experience per log received, compared to 25 experience when cutting normal trees. The tree does not always provide logs when cut, and can become depleted without ever giving logs. The bush can also provide multiple logs before becoming depleted. Unlike normal trees, the bush does not require empty inventory space to chop, and instead will provide no logs. The [[Infernal axe]] can burn logs received from this bush. Wearing [[Kandarin headgear]] will not provide extra logs. The [[Lumberjack outfit]] bonuses do work on these bushes. The chopping difficulty does not seem to operate the same as regular trees, since axe type and Woodcutting level do not seem to have any effect on the cut speed.

Both an axe and a machete are required to chop the bush. Attempting without an axe will print the message "You'll need an axe to get through this rough jungle. You don't think it would be a good idea to continue without one you've got the level to use." Attempting without a machete will print the message "You need a machete to cut your way through this dense jungle bush."

If the player is stuck in the dense jungle or on the south side within the Kharazi Jungle and attempts to chop the bush without the proper tools, there is an option to scrabble out of the jungle. The chatbox will show "It looks like you're lost in the jungle! Would you like to try and scrabble out?", followed by options for "Yes, I'll scrabble out of this jungle." or "No, I think I can find my own way out." Choosing to scrabble out will teleport the player to the north side of the dense jungle and deal a small amount of damage while printing the message {{RSFont|You scrabble out of the jungle. You're scratched to pieces by the dense jungle trees, but at least you're alive and out of the jungle.}}

